import React from "react";

function Card(props) {
    return (
        <dl className="dictionary">
            <div className="term">
            <dt>
            <span className="emoji">{props.emoji}</span>
            <span>{props.name}</span>
            </dt>
            <dd>{props.description}</dd>
            </div>
        </dl>
    );
}

export default Card;
